import React from 'react';
import ProgressBar from 'rc-progress-bar';

import './App.css';

function App() {
  return (
    <div class="App">
      <div>
        <ProgressBar 
          value={45} 
          showPercentage={true}
        />
      </div>
    </div>
  );
}

export default App;
